import './assets/css/App.css';
import Login from './components/Login';
import { Switch, BrowserRouter, Route } from 'react-router-dom';
import React from 'react';
import Dashboard from './components/Dashboard';
import Nuevo from './components/Nuevo';
import Editar from './components/Editar';

function App() {

  return (
<React.Fragment>
    <BrowserRouter>  
    <Switch>
    <Route path="/" exact render = { props=> (<Login {...props}/>)}></Route>
    <Route path="/dashboard" exact render = { props=> (<Dashboard {...props}/>)}></Route>
    <Route path="/nuevo" exact render = { props=> (<Nuevo {...props}/>)}></Route>
    <Route path="/editar/:id" exact render = { props=> (<Editar {...props}/>)}></Route>
    <Route path="/roles" exact render = { props=> (<Editar {...props}/>)}></Route>
    <Route path="/ingresar" exact render = { props=> (<Editar {...props}/>)}></Route>

    </Switch>


    </BrowserRouter>




</React.Fragment>
  );
}

export default App;
